import React from 'react';
import image1 from './sample.png';
import image2 from './sample2.png';
import './home.css';

function Home() {
    return (
        <div className="slideShowContainer">
            
            <div className="mySlidesFade">
            <img src={image1} style={{width:"100%"}} ></img>
            </div>
            
            <div className="mySlidesFade">
            <img src="" style={{width:"100%"}}></img>
            </div>      

           
            
        </div>
    );
}

export default Home;
